Dimensions: max. d. 215 mm; max. T 8.3; T terminals ~ 5 mm; T terminals adj to twisting ~6.5;

Circumstances: found about 1977 by Mr. Perry Cole, of Snippea [Shippea ?] Hill, hanging from his plowshare beam while removing vegetation accumulated during the plowing of a small plot of land at Snare Drove (a).  When it appeared at Sotheby’s sale it was provenanced instead to Norfolk;

Typology: terminals close to round section, inns flat; cables all flat or round crested (no apices);quad-lobate section; twists fairly regular; 164 coils

Manufacture: ? Torsion-twisted wax model

Surface: mostly rubbed dk brown/gold-flecked surface; grooves filled with v. pale green/white-powdery material - ? corr. products or calcareous?
